Description:
Gave operator updated Employee Health Policy form 1-B, reporting illness sheet, and foodborne illness sign.     Labeling requirements for house-made balsamic vinaigrette:
Label information shall include:
(1) The common name of the FOOD, or absent a common name, an adequately descriptive identity statement;
(2) If made from two or more ingredients, a list of ingredients in descending order of predominance by weight, including a declaration of artificial color or flavor and chemical
preservatives, if contained in the FOOD;
(3) An accurate declaration of the quantity of contents;
(4) The name and place of business of the manufacturer,
packer, or distributor     For more information about Mobile Food Truck Requirements Contact Rebecca Robbins at: 919-856-7419

page 77 of NC Food Code Manual:
3-401.14 NON-CONTINUOUS COOKING OF RAW ANIMAL FOODS:
Raw animal FOODS that are cooked using a NON-CONTINUOUS COOKING process shall be:
(A) Subject to an initial heating process that is no longer than sixty minutes in duration;
(B) Immediately after initial heating, cooled according to the time and temperature parameters specified for cooked POTENTIALLY HAZARDOUS FOOD (TIME /TEMPERATURE CONTROL FOR SAFETY FOOD) under ¶ 3-501.14(A);
(C) After cooling, held frozen or cold, as specified for POTENTIALLY HAZARDOUS FOOD (TIME/TEMPERATURE CONTROL FOR SAFETY FOOD) under ¶ 3-501.16(A)(2); P
(D) Prior to sale or service, cooked using a process that heats all parts of the FOOD to a temperature of at least 74°C (165°F) for 15 seconds;
(E) Cooled according to the time and temperature parameters specified for cooked POTENTIALLY HAZARDOUS FOOD (TIME /TEMPERATURE CONTROL FOR SAFETY FOOD) under ¶ 3-501.14(A) if not either hot held as specified under ¶3-501.16(A), served immediately, or held using time as a public health control as specified under §3-501.19 after complete cooking; P and
(F) Prepared and stored according to WRITTEN PROCEDURES that:
(1) Have obtained prior APPROVAL from the REGULATORY AUTHORITY;
(2) Are maintained in the FOOD ESTABLISHMENT and are available to the REGULATORY AUTHORITY upon request;
(3) Describe how the requirements specified under ¶ (A)-(E) of this Section are to be monitored and documented by the PERMIT HOLDER and the corrective actions to be taken if the requirements are not met; Pf
(4) Describe how the FOODS, after initial heating, but prior to complete cooking, are to be marked or otherwise identified as FOODS that must be cooked as specified under ¶ (D) of this section prior to being offered for sale or service; Pf and
(5) Describe how the FOODS, after initial heating but prior to cooking as specified under ¶(D) of this section, are to be separated from READY-TO-EAT FOODS as specified under ¶ 3-302.11 (D).

Educational note regarding proposed use of stone containers for guacamole:  Food code does not specifically address the use of stone as a food surface.  Food code requires that surfaces be "(1) SMOOTH; 
(2) Free of breaks, open seams, cracks, chips, inclusions, pits, and similar imperfections;
(3) Free of sharp internal angles, corners, and crevices; 
(4) Finished to have SMOOTH welds and joints".  They must also be safe, durable, non-absorbant and not allow the migration of deleterious substances, colors, smells, etc. to food.  Typical stone bowls used for guacamole are carved from porous and not-cleanable volcanic rock and cannot be approved.  ...  Educational note:  Menu does not explicitly offer any undercooked animal products.  However, PIC states that he would, under some circumstances, allow consumers to order undercooked foods if his staff verbally warned them that they might get sick.  If you are going to offer animal products undercooked, a consumer advisory warning on the menu is the best way to be in compliance with the requirement that consumers be warned of the dangers of undercooked animal products.  Consumer advisory example sheet provided.  Until menu can be brought into compliance, instruct servers to refuse to undercook any meats, seafood, poultry, or eggs.   ...  Remove speed rail from warewash sink at bar.
